import { Link } from "react-router-dom";
import styled from "styled-components";

const Container = styled.div`
display:flex
justify-content: center;
align-items: center;`;

function Nav() {
  return (
    <Container id="navbar">
      <h1>Baseball Data</h1>
      <Link>How It Works</Link>
      <Link>About</Link>
    </Container>
  );
}

export default Nav;
